import React from 'react'
import './Resume.css'

const Resume = () => {
  return (
    <section className='resume container section' id='resume'>
      <h2 className='section__title'>Expr</h2>
      <span className='section__subtitle'>My personal journey</span>
    </section>
  )
}

export default Resume
